logstash_filter:
filter {

    if [message] == "a" {
      mutate {
        add_field => {
          "abc" => "123"
          "d" => "1"
          "e" => "true"
          "f" => "2019-12-23T11:11:43.000Z"
        }
      }

      mutate {
        convert => {
          "abc" => "integer"
        }
      }
    }

    if [message] == "b" {
      mutate {
        add_field => {
          "abc" => "124"
          "d" => "2"
          "e" => "false"
          "f" => "f"
        }
      }
    }

    if [message] == "c" {
      mutate {
        add_field => {
          "abc" => "test"
          "d" => "3"
          "g" => "123.4"
        }
      }
    }

}
